Muchas personas piensan que el herrar le genera dolor o incomodidad. Nada más alejado de la realidad. 
El no encasquillar a un caballo puede generar deformación de los cascos además de múltiples lesiones en sus patas, por lo que se debe cambiar cada mes. Usar unas buenas herraduras y clavos es esencial. Por eso uso herraduras y clavos @kikeherraduras son las mejores. 
